import { useState, useEffect, useRef } from 'react';
import { marked } from 'marked';
import Header from './Header';
import Sidebar from './Sidebar';

export default function Chat() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [loading, setLoading] = useState(false);
  const [initializing, setInitializing] = useState(true);
  const bottomRef = useRef(null);
  const inputRef = useRef(null);

  useEffect(() => {
    const isReload = !sessionStorage.getItem('visited');
    sessionStorage.setItem('visited', 'true');

    if (isReload) {
      localStorage.removeItem('messages');
      setMessages([]);
    } else {
      const saved = localStorage.getItem('messages');
      if (saved) setMessages(JSON.parse(saved));
    }

    setInitializing(false);
  }, []);

  useEffect(() => {
    localStorage.setItem('messages', JSON.stringify(messages));
    bottomRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [messages]);

  const sendMessage = async (messageText) => {
    const text = typeof messageText === 'string' ? messageText : input;
    if (!text.trim()) return;

    setMessages((prev) => [...prev, { role: 'user', text }]);
    setInput('');
    setLoading(true);

    try {
      const res = await fetch('http://localhost:5000/api/chat', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ message: text }),
      });

      const data = await res.json();
      setMessages((prev) => [...prev, { role: 'ai', text: data.reply }]);
    } catch {
      setMessages((prev) => [
        ...prev,
        { role: 'ai', text: '⚠️ Something went wrong. Please try again.' },
      ]);
    } finally {
      setLoading(false);
    }
  };

  if (initializing) return null;

  return (
    <div className="flex min-h-screen bg-white dark:bg-black text-black dark:text-white transition-colors">
      {/* Sidebar (permanent left column) */}
      <Sidebar dark={true} setDark={() => {}} />

      {/* Main content area */}
      <div className="flex-1 flex flex-col">
        <Header />

        <main className="flex-1 flex flex-col items-center px-4 sm:px-8 pt-20 pb-6">
          <div className="max-w-3xl w-full space-y-4">
            {messages.map((msg, i) => (
              <div
                key={i}
                className={`p-4 rounded-xl text-sm sm:text-base whitespace-pre-wrap ${
                  msg.role === 'user'
                    ? 'bg-blue-100 dark:bg-blue-900 text-black dark:text-white'
                    : 'bg-zinc-100 dark:bg-zinc-800 text-black dark:text-white'
                }`}
                dangerouslySetInnerHTML={{ __html: marked.parse(msg.text) }}
              />
            ))}
            {loading && (
              <div className="p-4 rounded-xl bg-zinc-800 text-white text-sm italic animate-pulse">
                AS13 is typing...
              </div>
            )}
            <div ref={bottomRef} />
          </div>
        </main>

        {/* Input box */}
        <div className="py-4 px-4">
          <div className="max-w-2xl mx-auto relative">
            <textarea
              ref={inputRef}
              rows={2}
              placeholder="Ask anything..."
              className="w-full p-4 pr-14 rounded-xl bg-zinc-100 dark:bg-zinc-800 border border-zinc-300 dark:border-zinc-700 text-black dark:text-white placeholder-gray-500 dark:placeholder-gray-400 resize-none focus:outline-none focus:ring-2 focus:ring-blue-600 transition"
              value={input}
              onChange={(e) => setInput(e.target.value)}
              onKeyDown={(e) => {
                if (e.key === 'Enter' && !e.shiftKey) {
                  e.preventDefault();
                  sendMessage();
                }
              }}
            />
            <button
              onClick={sendMessage}
              disabled={!input.trim()}
              className="absolute top-3 right-2 w-12 h-12 bg-blue-600 hover:bg-blue-700 disabled:bg-zinc-700 rounded-lg flex items-center justify-center transition shadow"
              title="Send"
            >
              <svg
                xmlns="http://www.w3.org/2000/svg"
                className="h-5 w-5"
                fill="none"
                viewBox="0 0 24 24"
                stroke="currentColor"
                strokeWidth={2}
              >
                <path strokeLinecap="round" strokeLinejoin="round" d="M4 4l16 8-16 8V4z" />
              </svg>
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
